import React from 'react';
import Box from '@mui/material/Box';

const MathBoostersIcon = () => (
  <Box sx={{ height: 60, width: 60, mr: 2 }}>
    <img 
      src="https://cdn.discordapp.com/attachments/470219164070576148/1246571744148324383/Icon_Final1.png?ex=665cdfe7&is=665b8e67&hm=20c15b4aa37d944b55a905ba9c879fb35f8436535fd0fc43568a28a9d72b77c5&" 
      alt="Site Icon" 
      style={{ width: '100%', height: '100%' }}
    />
  </Box>
);

export default MathBoostersIcon;
